function prefetch(e){if(!document.querySelector('link[href="'.concat(e,'"]'))){var t=document.createElement("link");t.rel="prefetch",t.href=e,document.head.appendChild(t)}}document.querySelectorAll("a[data-prefetch]").forEach((function(e){var t=function(){return prefetch(e.href)};e.addEventListener("mouseenter",t),e.addEventListener("mousedown",t),e.addEventListener("touchstart",t,{passive:!0})}));